import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { toast } from 'react-hot-toast';
import {
  BookOpen,
  ClipboardList,
  FileCheck,
  Calendar,
  Users,
  GraduationCap,
  Building,
  ChevronRight
} from 'lucide-react';
import { Button } from '../../components/UI/Button';
import { Card, CardContent, CardHeader, CardTitle } from '../../components/UI/Card';
import studentApi from '../../services/studentApi';

// Import student components
import RegisterInternship from '../../components/student/RegisterInternship';
import PreliminaryReportCheck from '../../components/student/PreliminaryReportCheck';
import SubmitReport from '../../components/student/SubmitReport';
import ViewInternshipDuration from '../../components/student/ViewInternshipDuration';
import ViewMentorEvaluation from '../../components/student/ViewMentorEvaluation';
import ViewTeacherEvaluation from '../../components/student/ViewTeacherEvaluation';

const StudentDashboard = () => {
  const [dashboardData, setDashboardData] = useState({
    activeInternship: null,
    reports: {
      total: 0,
      pending: 0,
      approved: 0,
      rejected: 0
    },
    evaluations: {
      mentor: null,
      teacher: null
    },
    recentActivities: []
  });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      const data = await studentApi.dashboard.getOverview();
      setDashboardData(data);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
      setError('Failed to load dashboard data');
      toast.error('Failed to load dashboard data');
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-screen">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-emerald-500"></div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="flex items-center justify-center min-h-screen">
        <div className="text-red-500">{error}</div>
      </div>
    );
  }

  return (
    <div className="space-y-6 p-6">
      {/* Welcome Section */}
      <div className="bg-white rounded-lg shadow-sm p-6">
        <h1 className="text-2xl font-bold text-gray-900">Welcome to Your Dashboard</h1>
        <p className="mt-1 text-sm text-gray-500">Manage your internship journey</p>
      </div>

      {/* Main Grid Layout */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {/* Internship Registration/Status */}
        {!dashboardData.activeInternship ? (
          <RegisterInternship />
        ) : (
          <ViewInternshipDuration />
        )}

        {/* Preliminary Report Check */}
        <PreliminaryReportCheck />

        {/* Submit Report */}
        {dashboardData.activeInternship && (
          <SubmitReport />
        )}

        {/* Mentor Evaluation */}
        <ViewMentorEvaluation />

        {/* Teacher Evaluation */}
        <ViewTeacherEvaluation />

        {/* Reports Overview */}
        <Card>
          <CardHeader>
            <div className="rounded-lg bg-blue-500/10 p-2 w-fit">
              <ClipboardList className="h-6 w-6 text-blue-500" />
            </div>
            <CardTitle>Reports Overview</CardTitle>
          </CardHeader>
          <CardContent>
            <div className="space-y-4">
              <div className="grid grid-cols-2 gap-4">
                <div className="bg-gray-50 p-3 rounded-lg">
                  <p className="text-sm text-gray-500">Total Reports</p>
                  <p className="text-2xl font-bold">{dashboardData.reports.total}</p>
                </div>
                <div className="bg-green-50 p-3 rounded-lg">
                  <p className="text-sm text-gray-500">Approved</p>
                  <p className="text-2xl font-bold text-green-600">{dashboardData.reports.approved}</p>
                </div>
                <div className="bg-yellow-50 p-3 rounded-lg">
                  <p className="text-sm text-gray-500">Pending</p>
                  <p className="text-2xl font-bold text-yellow-600">{dashboardData.reports.pending}</p>
                </div>
                <div className="bg-red-50 p-3 rounded-lg">
                  <p className="text-sm text-gray-500">Rejected</p>
                  <p className="text-2xl font-bold text-red-600">{dashboardData.reports.rejected}</p>
                </div>
              </div>
              <Button variant="outline" className="w-full">
                View All Reports
              </Button>
            </div>
          </CardContent>
        </Card>
      </div>

      {/* Recent Activities */}
      <Card>
        <CardHeader>
          <CardTitle>Recent Activities</CardTitle>
        </CardHeader>
        <CardContent>
          <div className="space-y-4">
            {dashboardData.recentActivities.map((activity, index) => (
              <div
                key={index}
                className="flex items-center justify-between p-3 bg-gray-50 rounded-lg"
              >
                <div className="flex items-center space-x-3">
                  <div className="p-2 bg-white rounded-full">
                    {activity.type === 'report' ? (
                      <FileCheck className="h-4 w-4 text-emerald-500" />
                    ) : (
                      <Calendar className="h-4 w-4 text-blue-500" />
                    )}
                  </div>
                  <div>
                    <p className="text-sm font-medium">{activity.title}</p>
                    <p className="text-xs text-gray-500">{activity.description}</p>
                  </div>
                </div>
                <ChevronRight className="h-4 w-4 text-gray-400" />
              </div>
            ))}
          </div>
        </CardContent>
      </Card>
    </div>
  );
};

export default StudentDashboard;
